void EpsilonMapper::checkErrors(std::string dataset_name, int error_param){
    if (!VectorUtils::vectorIncludesString(DatasetUtils::DATASET_NAMES, dataset_name)){
        throw std::invalid_argument("The csv file has an invalid dataset name: \"" + dataset_name + "\".");
    }
    std::vector<int> valid_error_params = {0, 1, 3, 5, 10, 15, 20, 30};
    if (!VectorUtils::vectorIncludesInt(valid_error_params, error_param)){
        throw std::invalid_argument("The error param is invalid: \"" + std::to_string(error_param) + "\".");
    }
}

void EpsilonMapper::throwInvalidFilenameError(std::string dataset_name, std::string dataset_filename){
    throw std::invalid_argument("Invalid filename \"" + dataset_filename + "\" for dataset \"" + dataset_name + "\".");
}
